void waitSeconds(int seconds) {
    unsigned int cycles = TIMERSEC * seconds;
    // Configure the timer
    timer->control = 0x8; // stop the timer
    timer->status = 0; // reset TO
    timer->periodlo = cycles & 0x0000FFFF;
    timer->periodhi = (cycles & 0xFFFF0000) >> 16;
    timer->control = 0x4;
    
    // Wait until the timer expires
    while ((timer->status & 0x1) == 0);
    
    // Reset the timer status
    timer->status = 0; // reset TO
}

double power(double base, int exponent) {
    double result = 1.0;
    for (int i = 0; i < exponent; i++) {
        result *= base;
    }
    return result;
}


void the_exception(void)
/*******************************************************************************
 * Exceptions code. By giving the code a section attribute with the name
 * ".exceptions" we allow the linker program to locate this code at the proper
 * exceptions vector address.
 * This code calls the interrupt handler and later returns from the exception.
 ******************************************************************************/
{
  asm("subi sp, sp, 128");
  asm("stw et, 96(sp)");
  asm("rdctl et, ctl4");
  asm("beq et, r0, SKIP_EA_DEC");  // Interrupt is not external
  asm("subi ea, ea, 4");           /* Must decrement ea by one instruction
                                    * for external interupts, so that the
                                    * interrupted instruction will be run */
  asm("SKIP_EA_DEC:");
  asm("stw r1, 4(sp)");  // Save all registers asm("stw r2, 8(sp)");
  asm("stw r2, 8(sp)");
  asm("stw r3,  12(sp)");
  asm("stw r4,  16(sp)");
  asm("stw r5,  20(sp)");
  asm("stw r6,  24(sp)");
  asm("stw r7,  28(sp)");
  asm("stw r8,  32(sp)");
  asm("stw r9,  36(sp)");
  asm("stw r10, 40(sp)");
  asm("stw r11, 44(sp)");
  asm("stw r12, 48(sp)");
  asm("stw r13, 52(sp)");
  asm("stw r14, 56(sp)");
  asm("stw r15, 60(sp)");
  asm("stw r16, 64(sp)");
  asm("stw r17, 68(sp)");
  asm("stw r18, 72(sp)");
  asm("stw r19, 76(sp)");
  asm("stw r20, 80(sp)");
  asm("stw r21, 84(sp)");
  asm("stw r22, 88(sp)");
  asm("stw r23, 92(sp)");
  asm("stw r25, 100(sp)");
  asm("stw r26, 104(sp)");
  asm("stw r26, 104(sp)");
  asm("stw r28, 112(sp)");
  asm("stw r29, 116(sp)");
  asm("stw r30, 120(sp)");
  asm("stw r31, 124(sp)");
  asm("addi   fp,  sp, 128");
  asm("call interrupt_handler");
  asm("ldw r1, 4(sp)");
  asm("ldw r2, 8(sp)");
  asm("ldw r3, 12(sp)");
  asm("ldw r4, 16(sp)");
  asm("ldw r5,  20(sp)");
  asm("ldw r6,  24(sp)");
  asm("ldw r7,  28(sp)");
  asm("ldw r8,  32(sp)");
  asm("ldw r9,  36(sp)");
  asm("ldw r10, 40(sp)");
  asm("ldw r11, 44(sp)");
  asm("ldw r12, 48(sp)");
  asm("ldw r13, 52(sp)");
  asm("ldw r14, 56(sp)");
  asm("ldw r15, 60(sp)");
  asm("ldw r16, 64(sp)");
  asm("ldw r17, 68(sp)");
  asm("ldw r18, 72(sp)");
  asm("ldw r19, 76(sp)");
  asm("ldw r20, 80(sp)");
  asm("ldw r21, 84(sp)");
  asm("ldw r22, 88(sp)");
  asm("ldw r23, 92(sp)");
  asm("ldw r24, 96(sp)");
  asm("ldw r25, 100(sp)");
  asm("ldw r26, 104(sp)");

  asm("ldw r28, 112(sp)");
  asm("ldw r29, 116(sp)");
  asm("ldw r30, 120(sp)");
  asm("ldw r31, 124(sp)");

  asm("addi   sp,  sp, 128");
  asm("eret");
}

void interrupt_handler(void) {
  
int ipending;
NIOS2_READ_IPENDING(ipending);
if (ipending & 0x40) // interval timer is interrupt level 0 {
   audio_ISR();

if (ipending & 0x80) // pushbuttons are interrupt level 1 {
   keyboard_ISR();

    // else, ignore the interrupt
return; 

}

void keyboard_ISR() {
	volatile int *PS2_ptr = (int *)PS2_BASE;
  PS2_data = *(PS2_ptr);  // read the Data register in the PS/2 port RVALID
  /* shift the next data byte into the display */
  byte1 = byte2;
  byte2 = byte3;
  byte3 = PS2_data & 0xFF;
  if ((byte2 == (char)0xAA) &&
      (byte3 == (char)0x00)) {  // mouse inserted; initialize sending of data
    *(PS2_ptr) = 0xF4;
  }
  if (byte3 == (char)0x74 && byte2 == (char)0xE0) {
    if (slab_x + 50 <= 315) slab_x += 15;
  }
  if (byte3 == (char)0x6B && byte2 == (char)0xE0) {
    if (slab_x >= 4) slab_x -= 15;
  }

  if (byte3 == 0x29 && !in_progress) {
    start_game = true; // Set the flag to true
  // else, ignore the interrupt
  }
  return;

}

void audio_ISR() {
	struct audio_t *const audiop = (struct audio_t *)AUDIO_BASE;
	audiop->control = 0b1100;  // set control register to 1100 to clear input and output fifos
    audiop->control = 0x0; // set to zero to allow samples to flow into the fifos

	// Check switch values periodically and update frequency
	// Output data if there is space in the output FIFOs
	if (tile_sound) {
		tile_sound = false;
		for (int i = 0; i < sizeof(tile_s)/sizeof(int); i++) {
			if ((audiop->wsrc != 0) && (audiop->wslc != 0)) {
				audiop->ldata = tile_s[i]; // Output to left channel
				audiop->rdata = tile_s[i]; // Output to right channel
			}
		}
	}
	else if (slab_sound) {
		slab_sound = false;
		for (int i = 0; i < sizeof(slab_s)/sizeof(int); i++) {
			if ((audiop->wsrc != 0) && (audiop->wslc != 0)) {
				audiop->ldata = slab_s[i]; // Output to left channel
				audiop->rdata = slab_s[i]; // Output to right channel
			}
		}
	}
	volatile int *AUDIO_ptr = (int *)AUDIO_BASE;
	*AUDIO_ptr = 0x0;
	return;
}

void write_char(int x, int y, char c) {
  // VGA character buffer
  volatile char * character_buffer = (char *) (0x09000000 + (y<<7) + x);
  *character_buffer = c;
}

